var app = require('./server.js');
var req = require('supertest');

describe("Initial tests", () => {
  it("should respond with test get request ", async() => {
    var res = await req(app).get("/test");
    expect(res.body).toEqual({getTest: 'passed'});
    expect(res.body.getTest).toEqual('passed');
  });

  it("should respond with test post request ", async() => {
    var res = await req(app).post("/test");
    expect(res.body).toEqual({postTest: 'passed'});
    expect(res.body.postTest).toEqual('passed');
  });
});


describe("test for products API", () => {
  it("should respond with test get request ", async() => {
    var res = await req(app).get("/products");
    expect(res.statusCode).toBe(200);
    expect(Array.isArray(res.body)).toEqual(true);
    expect(Object.keys(res.body[0])).toEqual(['id', 'name', 'slogan', 'description', 'category',
      'default_price']);
  });
});

describe("test for products/id API", () => {
  it("should respond with test get request ", async() => {
    var res = await req(app).get("/products/1");
    expect(res.statusCode).toBe(200);
    expect(typeof res.body).toEqual('object');
    expect(Object.keys(res.body)).toEqual(['id', 'name', 'slogan', 'description', 'category',
      'default_price', 'features']);
    expect(res.body).toEqual({
      "id": 1,
      "name": "Camo Onesie",
      "slogan": "Blend in to your crowd",
      "description": "The So Fatigues will wake you up and fit you in. This high energy camo will have you blending in to even the wildest surroundings.",
      "category": "Jackets",
      "default_price": "$140.00",
      "features": [
          {
              "feature:": "Fabric",
              "value:": "Canvas"
          },
          {
              "feature:": "Buttons",
              "value:": "Brass"
          }
      ]
    });
  });
});

describe("test for products/id/related API", () => {
  it("should respond with test get request ", async() => {
    var res = await req(app).get("/products/4/related");
    expect(res.statusCode).toBe(200);
    expect(Array.isArray(res.body)).toEqual(true);
    expect(res.body).toEqual([1,2,4,5,8]);
  });
});

